  savetoDB(){
    var that = this;
    if(that.ActionTaken != 0){
      this.selectedLeave.forEach(function(row){
        that.http.put(that.global.api+'LeaveManagement/Leave/ActionTaken/'+row.leaveId,{
                  "IdNumber": that.data.selectedID,
                  "ActionTaken": that.ActionTaken,
                  "ApprovedByHeadOfOffice":that.global.requestid(),
                  "TotalMinutes": row.totalMinutes,
                  "HeadOfOfficeRemarks": that.Remarks
                },that.global.option)
                  .map(response => response.json())
                  .subscribe(res => {
                    // console.log(res) 
                    that.global.swalAlert(res.message,"",'success');
                    that.dialogRef.close({result:"success"}); 
                  },Error=>{
                    that.global.swalAlertError();
                    console.log(Error)
                  });
      });
    }
    else{
      this.global.swalAlert('Warning','Please choose an action','error')

    }
  }

